/*Table structure for table `city` */

DROP TABLE IF EXISTS `city`;

CREATE TABLE `city` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cityId` mediumint(6) unsigned zerofill NOT NULL DEFAULT '000000' COMMENT '城市编号',
  `parentId` mediumint(6) unsigned zerofill NOT NULL DEFAULT '000000' COMMENT '所属上级编号',
  `level` tinyint(1) NOT NULL DEFAULT '0' COMMENT '自身级别：省1，市2，县3，预留0为国。',
  `cityName` varchar(20) NOT NULL DEFAULT '' COMMENT '城市名称',
  `cityFullName` varchar(45) NOT NULL DEFAULT '' COMMENT '城市名称全称',
  `baiduCityId` varchar(10) NOT NULL DEFAULT '' COMMENT '百度上对应的城市code',
  `longitude` decimal(25,12) NOT NULL DEFAULT '0.000000000000' COMMENT '城市百度经度',
  `latitude` decimal(25,12) NOT NULL DEFAULT '0.000000000000' COMMENT '城市百度纬度',
  `createBy` int(11) NOT NULL DEFAULT '0' COMMENT '创建人',
  `createTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `version` smallint(6) NOT NULL DEFAULT '1' COMMENT '数据版本控制',
  `deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标记',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uniq_cityId` (`cityId`) USING BTREE,
  KEY `idx_cityId_cityName` (`cityId`,`cityName`) USING BTREE,
  KEY `idx_longitude_latitude` (`longitude`,`latitude`)
) ENGINE=InnoDB AUTO_INCREMENT=4341 DEFAULT CHARSET=utf8 COMMENT='城市信息表';

